import "../styles/NavigationBar.css";
import logo from "../images/Bullbear logo.png";
import React, { useState, Component} from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

class Navbar extends Component() {

    state={
        items: [],
        text: ""
    }
    showTicker=()=>{
        axios.get('http://127.0.0.1:8000/ticker/')
        .then((res)=>{
            console.log(res.data[0].Ticker)
            this.setState({Ticker:res.data})
        })
    }

    addTicker=(d)=>{{
        if(this.state.text !== ""){
            axios.post('http://127.0.0.1:8000/ticker/create/',d)
            .then((res)=>{
                this.showTicker()
                console.log(res.data)
            })
            .catch(error => {
                console.log(error)
            })
        }
    }
    }

    handleSearchInputChange=e => {
        this.setState({text:e.target.value})
    }

    handleSearchEnter=e=> {
        if(e.button == "Enter") {
            let dt = { item: this.state.text}
            addTicker(dt);
            window.location.href = '/search/:ticker';
        }
    }

    handleSignUpClick=() =>{
        window.location.href = '/signup';
    }

    handleLoginClick=() =>{
        window.location.href = '/login';
    }

    componentDidMount() {
        this.showTicker()
    }

    render() {
        return (
            <nav>
                <div className="logo">
                    <img src={logo} alt="Company Logo" />
                    <h1>Bulls and Bears</h1>
                </div>
                <div className="search-bar">
                    <input
                        type="text"
                        placeholder="Search your Stock here..."
                        value={this.state.text}
                        onChange={this.handleSearchInputChange}
                        onKeyDown={this.handleSearchEnter}
                    />
                </div>
                <div className="auth-buttons">
                    <button onClick={this.handleSignUpClick}>Sign Up</button>
                    <button onClick={this.handleLoginClick}>Log in</button>
                </div>
            </nav>
        );
    } 
}

export default Navbar;
